import Header from "./Header";

const Layout = props => (
  <div>
    <Header className="header" />
    <div className="layoutStyle">{props.children}</div>
    <style jsx>
      {`
        * {
          box-sizing: border-box;
          margin: 0;
          padding: 0;
        }

        .layoutStyle {
          height: 100%;
          pointer-events: none;
          position: absolute;
          top: 0;
          width: 100%;
        }
      `}
    </style>
  </div>
);

export default Layout;
